DROP TABLE IF EXISTS gdm_video_device CASCADE;

CREATE TABLE gdm_video_device (
    id numeric(16,0) DEFAULT nextval('seq_id'::regclass),
    code character varying(50) NOT NULL,
    name character varying(255) NOT NULL,
    type numeric(16,0) NOT NULL,
    status numeric(1,0) NOT NULL,
    address character varying(255) NOT NULL,
    org_id numeric(16,0) NOT NULL,
    lon numeric(9,6) NOT NULL,
    lat numeric(9,6) NOT NULL,
    create_time timestamp without time zone NOT NULL,
    update_time timestamp without time zone NOT NULL,
    geom geometry NOT NULL,
    valid integer NOT NULL DEFAULT 1
);


CREATE UNIQUE INDEX ds_video_device_pkey ON gdm.gdm_video_device USING btree (id);

COMMENT ON COLUMN gdm_video_device.id IS 'id';
COMMENT ON COLUMN gdm_video_device.code IS '视频编码';
COMMENT ON COLUMN gdm_video_device.name IS '名称';
COMMENT ON COLUMN gdm_video_device.type IS '类型，包括道路监控、车载移动视频终端等';
COMMENT ON COLUMN gdm_video_device.status IS '状态，0-不在线，1-在线';
COMMENT ON COLUMN gdm_video_device.address IS '安装地址';
COMMENT ON COLUMN gdm_video_device.org_id IS '所属组织机构ID';
COMMENT ON COLUMN gdm_video_device.lon IS '经度';
COMMENT ON COLUMN gdm_video_device.lat IS '纬度';
COMMENT ON COLUMN gdm_video_device.create_time IS '创建时间';
COMMENT ON COLUMN gdm_video_device.update_time IS '更新时间';
COMMENT ON COLUMN gdm_video_device.geom IS 'geom';
COMMENT ON COLUMN gdm_video_device.valid IS 'valid';

